import React, { useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { api } from '../../utils/api';
import { toast } from 'react-toastify';

const TaskCreate = () => {
  const { gameId } = useParams();
  const navigate = useNavigate();
  
  const [isSubmitting, setIsSubmitting] = useState(false);
  
  // Task form state
  const [taskForm, setTaskForm] = useState({
    title: '',
    description: '',
    type: 'text', // Default type
    category: '',
    rewardPoints: 10,
    riskPoints: 5,
    timeLimit: 30,
    // Add other fields as needed for your task
  });
  
  // Handle form changes
  const handleFormChange = (e) => {
    const { name, value, type, checked } = e.target;
    setTaskForm(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : 
              type === 'number' ? parseInt(value, 10) : value
    }));
  };
  
  // Handle task creation
  const handleCreateTask = async (e) => {
    e.preventDefault();
    
    try {
      setIsSubmitting(true);
      
      // Format task data
      const taskData = {
        ...taskForm,
        game: gameId // Associate with the game
      };
      
      // Create task - using direct API call
      await api.post('/api/tasks', taskData);
      
      toast.success('Opgave oprettet!');
      
      // Redirect back to game management page
      navigate(`/admin/games/${gameId}`);
      
    } catch (error) {
      console.error('Error creating task:', error);
      toast.error(error.response?.data?.message || 'Der opstod en fejl ved oprettelse af opgaven');
      setIsSubmitting(false);
    }
  };
  
  return (
    <div className="max-w-3xl mx-auto py-8 px-4">
      <h1 className="text-3xl font-bold text-blue-900 mb-6">Opret ny opgave</h1>
      
      <form onSubmit={handleCreateTask} className="bg-white rounded-lg shadow-md p-6">
        {/* Basic Info Section */}
        <div className="mb-6">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">Basis information</h2>
          
          <div className="mb-4">
            <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="title">
              Opgavetitel *
            </label>
            <input
              className="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="title"
              type="text"
              name="title"
              value={taskForm.title}
              onChange={handleFormChange}
              placeholder="F.eks. Find historisk information"
              required
            />
          </div>
          
          <div className="mb-4">
            <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="description">
              Beskrivelse *
            </label>
            <textarea
              className="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              id="description"
              name="description"
              rows="4"
              value={taskForm.description}
              onChange={handleFormChange}
              placeholder="Beskriv opgaven detaljeret - hvad skal deltagerne gøre?"
              required
            ></textarea>
          </div>
          
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="type">
                Opgavetype *
              </label>
              <select
                className="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="type"
                name="type"
                value={taskForm.type}
                onChange={handleFormChange}
                required
              >
                <option value="text">Tekstbesvarelse</option>
                <option value="multiple_choice">Multiple choice</option>
                <option value="video">Videobesvarelse</option>
              </select>
            </div>
            
            <div>
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="category">
                Kategori
              </label>
              <input
                className="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="category"
                type="text"
                name="category"
                value={taskForm.category}
                onChange={handleFormChange}
                placeholder="F.eks. Historie, Fakta, etc."
              />
            </div>
          </div>
        </div>
        
        {/* Points and Timing Section */}
        <div className="mb-6">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">Point og tidsbegrænsning</h2>
          
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <div>
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="rewardPoints">
                Belønningspoint *
              </label>
              <input
                className="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="rewardPoints"
                type="number"
                name="rewardPoints"
                min="0"
                value={taskForm.rewardPoints}
                onChange={handleFormChange}
                required
              />
              <p className="text-xs text-gray-500 mt-1">
                Point der gives ved korrekt besvarelse
              </p>
            </div>
            
            <div>
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="riskPoints">
                Risikopoint *
              </label>
              <input
                className="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="riskPoints"
                type="number"
                name="riskPoints"
                min="0"
                value={taskForm.riskPoints}
                onChange={handleFormChange}
                required
              />
              <p className="text-xs text-gray-500 mt-1">
                Point der fratrækkes ved forkert besvarelse
              </p>
            </div>
            
            <div>
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="timeLimit">
                Tidsbegrænsning (minutter) *
              </label>
              <input
                className="appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="timeLimit"
                type="number"
                name="timeLimit"
                min="1"
                value={taskForm.timeLimit}
                onChange={handleFormChange}
                required
              />
              <p className="text-xs text-gray-500 mt-1">
                Tid til at løse opgaven i minutter
              </p>
            </div>
          </div>
        </div>
        
        {/* Task Type Specific Fields */}
        {taskForm.type === 'multiple_choice' && (
          <div className="mb-6">
            <h2 className="text-xl font-semibold text-gray-800 mb-4">Multiple choice indstillinger</h2>
            
            {/* Here you would add your multiple choice options UI */}
            <p className="text-sm text-gray-600">
              Du kan tilføje svarmuligheder efter opgaven er oprettet.
            </p>
          </div>
        )}
        
        {/* Submit Buttons */}
        <div className="mt-8 flex justify-end space-x-4">
          <button
            type="button"
            onClick={() => navigate(`/admin/games/${gameId}`)}
            className="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded"
          >
            Annuller
          </button>
          
          <button
            type="submit"
            disabled={isSubmitting}
            className="bg-blue-800 hover:bg-blue-900 text-white font-bold py-2 px-4 rounded"
          >
            {isSubmitting ? (
              <span className="flex items-center">
                <svg className="animate-spin -ml-1 mr-2 h-4 w-4 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                  <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
